import React from 'react';
import ReactDOM from 'react-dom';
import './Logo.css';

class Menu extends React.Component {
  render() {
    return (
      <div >
        <div id="logoImage" class="col-12">
          <img class="img-fluid first col-6 ml-5 mt-4" src="../../../public/img/newLogo1.png"/>
          <div class="myPic">
            <img class="img-fluid second rounded col-6" src="../../../public/img/mais.png"/>
          </div>
        </div>
      </div>
    );
  }
}

export default Menu;
